ara Teletrabajo | Por la mañana - Mueve la energía para enfocar tu mente"},"description":{"simpleText":"👉🏻 Descubre esta rutina de 4 semanas de yoga dinámico y retador para progresar en tu práctica: https://xlystudio.info/MultiestiloDinamico\n\n________________\n\n🧘🏻‍♀️  PRUEBA GRATIS XLY STUDIO ► https://bit.ly/descubrir-xly-studio\n\nClase de yoga suave indicada para practicar por la mañana, especialmente si estás trabajando desde casa. Mueve la energía de todo el cuerpo con esta clase easy flow y comienza tu día con la mente enfocada. \n\nNinguno de los productos de Solgar utiliza azúcar, sales y/o ingredientes innecesarios de relleno. También ofrece fórmulas aptas para vegetarianos. Si quieres saber cuales son mis suplementos favoritos, puedes consultar mi selección aquí: https://xuanlanyoga.com/tienda/#productosnaturales \n\nMi Web 👉🏻 https://xuanlanyoga.com/\n\nSi quieres aprender más yoga, en mi canal Xuan Lan Yoga te esperan NUEVOS VÍDEOS DE YOGA CADA SEMANA: posturas de yoga para principiantes y avanzados, ejercicios de relajación y meditación, consejos para una vida saludable... ¡Anímate a practicar yoga en casa conmigo!  \n\n---------------------------------------------\nDescubre mis programas\n---------------------------------------------\n\nBases del Vinyasa: http://bit.ly/programa-bases-del-vinyasa \nIniciación al Yoga: http://bit.ly/programa-iniciacion-yoga\nIniciación a la Meditación: http://bit.ly/programa-iniciacion-meditacion \nFIT+Yoga: https://bit.ly/programa-fit-yoga \nTodos los programas: https://bit.ly/programas-xuan-lan-yoga\n\n-----------------------------------\nSígueme en las redes\n-----------------------------------\n \nFacebook: https://goo.gl/bwxebJ\nInstagram: https://bit.ly/2P920Gy\nGoogle+: https://goo.gl/b1aJkB\n\n------------------------------------\nSobre Xuan Lan Yoga\n------------------------------------\n \nSoy Xuan Lan, profesora de yoga, y mi objetivo es transmitir que el yoga es mucho más que una serie de ejercicios físicos; es un estilo de vida. Por ello, en mi canal quiero mostrarte todos los beneficios del yoga. En las clases de yoga que imparto aprenderás todas las posiciones de yoga que ansías conocer, así como sus modalidades, ejercicios de relajación y meditación, consejos... ¡Todo lo necesario para practicar yoga en casa!"},"lengthSeconds":"1334","ownerProfileUrl":"http://www.youtube.com/@XuanLanYoga","externalChannelId":"UCKQgiVPqEPU0tImAjFG5lNA","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RU","RW","SA","SB","SC","SD","SE","SG","SH","SI","SJ","SK","SL","SM","SN","SO","SR","SS","ST","SV","SX","SY","SZ","TC","TD","TF","TG","TH","TJ","TK","TL","TM","TN","TO","TR","TT","TV","TW","TZ","UA","UG","UM","US","UY","UZ","VA","VC","VE","VG","VI","VN","VU","WF","WS","YE","YT","ZA","ZM","ZW"],"isUnlisted":false,"hasYpcMetadata":false,"viewCount":"295017","category":"Sports","publishDate":"2020-12-03T09:30:01-08:00","ownerChannelName":"Xuan Lan Yoga","uploadDate":"2020-12-03T09:30:01-08:00","isShortsEligible":false}},"cards":{"cardCollectionRenderer":{"cards"
